import {Link, Router} from 'react-router-dom'

function Nav() {
    return (
      <Router>
        <nav>
        <ul className="links">
          <li><Link to="home">Home</Link></li>
          <li>Saved Recipes</li> 
          <li>Create New Recipe</li>
          <li><Link to="about">About</Link></li>
        </ul>
      </nav>
    </Router>
    
    );
  }
  
  export default Nav;
